import React from 'react'
import styled from 'styled-components'

const StyledCover = styled.div`
font-size: 2rem;
width: 100%;
height: 7rem;
border: 1px solid var(--color-border);
${CoverWrapper} {
    display: none;
}
`
const CoverWrapper = styled.div`
    width: 100%
`

const Cover = ({ title, children }) => {
    return (
        <StyledCover>
            { title }</StyledCover>
    )
}

export default Cover
